== Awards == * The [[Brownlow Medal]] was awarded to [[Scott Wynd]] of {{AFL Foo}}. * The [[Leigh Matthews Trophy]] was awarded to [[Jason Dunstall]] of {{AFL Haw}}. * The [[Coleman Medal]] was awarded to [[Jason Dunstall]] of {{AFL Haw}}. * The [[Norm Smith Medal]] was awarded to [[Peter Matera]] of {{AFL WC}}. * The Wooden Spoon was "awarded" to {{AFL Syd}}.
== Notable events == * In Round 7, {{AFL Gee}} set the current record for highest score in a game, scoring 37.17 (239) against {{AFL BB}}. This beat {{AFL Fit}}'s [[1979 VFL season|thirteen year old]] record by one point, and is yet to be broken. * Geelong also set records for most points scored in a home-and-away season (3,057) and in all games (3,558) which again have not been broken. * In Round 23 following torrential rain at the Western Oval, West Coast kicked only 0.2 (2) to three-quarter time. This is the lowest three-quarter time score since [[1953 VFL season|1953]] and the second-lowest since 1908. ** The 1992 Eagles are one of only five premier sides to kick a season's lowest score (also in [[1923 VFL season|1923]], [[1968 VFL season|1968]], [[1970 VFL season|1970]] and [[1995 AFL season|1995]]) but the only one of those to have also kicked the second-lowest score (Carlton in [[1904 VFL season|1904]] and Richmond in [[1927 VFL season|1927]] kicked the season's two lowest scores and lost the Grand Final). * In Round 6, Essendon set a record for the best comeback when they were 47 points down early in the last quarter and beat Melbourne by a point. * The [[McIntyre System#First McIntyre final six system|First McIntyre "Final Six" system]], which had operated in 1991, was replaced by the [[McIntyre System#Second McIntyre final six system|Second McIntyre "Final Six" system]]. The second McIntyre "Final Six" system only lasted two seasons; it was replaced by the [[McIntyre System#McIntyre final eight system|McIntyre "Final Eight" system]] in 1994.
